inefficient_solution:
class Solution:
    def containsDuplicate(self, nums: List[int]) -> bool:
        num_dict = {}
        for num in nums:
            num_dict[num] = None
        for num in nums:
            num_dict[num] = None
        return len(num_dict) != len(nums)

canonical_solution:
class Solution:
    def containsDuplicate(self, nums: List[int]) -> bool:
        return len(set(nums)) < len(nums)
